import { checkPrivateStaticAccess, checkPrivateStaticFieldDescriptor, applyDescriptorGet } from "./classPrivateMethods.js";

export default function getStaticPrivateField(receiver, classConstructor, descriptor) {
  checkPrivateStaticAccess(receiver, classConstructor);
  checkPrivateStaticFieldDescriptor(descriptor, "get");
  return applyDescriptorGet(receiver, descriptor);
}
